import React from 'react';
import {  Layout,Menu } from 'antd';
import { DashboardOutlined, UserOutlined, DashboardFilled } from '@ant-design/icons';

import User from '../User/User'

// import 'antd/dist/antd.css';
import '../../style/custom-antd.css'
import './styles.css'


const Main = () => {
    const { Header, Content, Sider } = Layout;
    const [open, setOpen] = React.useState(false)
    const handleClick = e => {
        console.log('click ', e);
    };
    const handleCollapse = () => {
        setOpen(!open)
    }
    return ( 
        <div>
            <Layout style={{ height: '100vh', overflow:'hidden'}}>
                <Sider width={200} className="sider"
                // collapsible collapsed={open}
                // onCollapse={handleCollapse}
                >
                    <div className="logo">
                        LOGO
                    </div>
                    <Menu
                        primaryColor= "#F5222D"
                        onClick={handleClick}
                        style={{ height: '100%', borderRightColor:'transparent', 
                        backgroundColor:'#363740', 
                        // backgroundColor: 'white',
                        color:'#9C9EAA'}} defaultSelectedKeys={['1']}
                        defaultOpenKeys={['sub1']}
                        mode="inline"
                    >
                        <Menu.Item className="menuItem" key="1" icon={<DashboardOutlined />}>Overview</Menu.Item>
                        <Menu.Item key="2" icon={<UserOutlined />}>Users</Menu.Item>   
                    </Menu>
                </Sider>
                <Layout>
                    <Header className="header">
                        Header
                    </Header>
                    <Content className="content" style={{}}>
                        <User />
                    </Content>
                </Layout>
            </Layout>
        </div>
     );
}

export default Main;
